import React, { useEffect, useState } from 'react';
import '../../css/addExam.css';
import axios from 'axios';
import { useLocation, useNavigate } from 'react-router-dom';

const AddExam = () => {
    const location = useLocation();
    const email = location.state?.email;
    
    const [userRole, setUserRole] = useState('');
    const navigate = useNavigate();

    const user = JSON.parse(localStorage.getItem("user"));
    
        useEffect(() => {
            if (user.isAdmin) {
                setUserRole("Admin");
            } else {
                setUserRole("User");
            }
        }, [user]);
    
    return (
        <div>

            <div className='div-box'>
                <div className='left-side-nav-bar'>

                    <div className='nav-bar'>
                        <div className='home-btn' onClick={()=>navigate('/home')}>
                            <label>Home</label>
                        </div>

                        <div className='report-btn' onClick={()=>navigate('/reports')}>
                            <label>Reports</label>
                        </div>

                        {user.isAdmin && (
                            <div className='exam-btn' onClick={()=>navigate('/exam')}>
                                <label>Exam</label>
                            </div>
                        )}

                        <div className='logout-btn'>
                            <label>Logout</label>
                        </div>
                    </div>

                </div>

                <div className='exam-top-menu'>
                    <label className='title'>Quiz Application</label>
                    <div className='details'>
                        <label className='name'>Name: {user?.username}</label><br />
                        <label className='role'>Role: {userRole}</label>
                    </div>
                </div>
                
                <label className='add-exam-label'>Add Exam</label>
                
                <div className="form-container">

                    <form className="exam-form">
                        <div className="form-row">
                            <div className="form-group">
                                <label>Exam Name</label>
                                <input type="text" placeholder="Enter Exam Name" />
                            </div>

                            <div className="form-group">
                                <label>Exam Duration</label>
                                <input type="number" placeholder="Enter Duration (mins)" />
                            </div>

                            <div className="form-group">
                                <label>Category</label>
                                <select>
                                    <option>Select Category</option>
                                    <option>Math</option>
                                    <option>Science</option>
                                    <option>History</option>
                                </select>
                            </div>

                        </div>

                        <div className="form-row">
                            <div className="form-group">
                                <label>Total Marks</label>
                                <input type="number" placeholder="Enter Total Marks" />
                            </div>

                            <div className="form-group">
                                <label>Passing Marks</label>
                                <input type="number" placeholder="Enter Passing Marks" />
                            </div>
                        </div>

                        <div className="form-buttons">
                            <button type="button" className="btn-cancel" onClick={()=>navigate('/exam')}>Cancel</button>
                            <button type="submit" className="btn-save">Save</button>
                        </div>

                    </form>
                </div>
            </div>
        </div>
    );
};

export default AddExam;
